import React from 'react'
import { ListContainer, Row, Text, DeleteIcon } from './styles'

function TodoList({todos}) {
  console.log(todos, 'hi  TODOLIST')
  return (
    <div>
      <ListContainer>
        {todos?.map((todo) => (
          <Row key={todo._id}>
            <Text>{todo.text}</Text>
            <DeleteIcon>X</DeleteIcon>
          </Row>
        ))}
      </ListContainer>
    </div>
  )
}

export default TodoList
